<script>
function Queue(){
    var items = [];
    this.enqueue = function(element){
        items.push(element);
    }
    this.dequeue = function(){
        return items.shift();
    }
    this.front = function(){
        return items[0];
    }
    this.isEmpty = function(){
        return items.length == 0;
    }
    this.print = function(){
        console.log(items.toString());
    }
    this.size = function(){
        return items.length;
    }
}
var queue = new Queue();
console.log(queue.isEmpty())
queue.enqueue(5);
queue.enqueue(6);
queue.print();
</script>
